import React from 'react';
import '../../Styles/Contact.css';


export default function Contact() {
  return (
            <div id="contact"> 
                    <div className="container py-5">
                        <div className="text-center">
                            <h2>ContactMe</h2>
                        </div>
                        <div className="contactParagraph text-center">
                            <p>To contact me and ask for my service, just fill the form and I will contact you as soon as possible.</p>
                        </div>
                        <div className="row">
                            <div className="col-12 col-sm-6 col-lg-6 d-flex justify-content-center "> 
                                <form className="form d-flex flex-collum justify-content-center align-content-center">

                                </form>
                            </div>
                        </div>
                    </div>
            </div>
    );
}
